from typing import List

class Solution:
    def findAnagrams(self, s: str, p: str) -> List[int]:
        def isAnagram(a, b):
            return sorted(a) == sorted(b)

        n = len(p)
        arr = list()
        for i, ch in enumerate(s):
            if ch in p:
                chunk = s[i:i+n]
                if isAnagram(chunk, p):
                    arr.append(i)
        return arr

